The first thing we’ll do is create a fuzz target in the form of a Rust binary crate. AFL will call the resulting binary, supplying generated bytes to standard input that we’ll pass to Url::parse. cargo new --bin url-fuzz-target
cd url-fuzz-target We’ll need two dependencies in this crate: url: the crate we’re fuzzing afl: not required, but includes a couple utility functions to assist in creating fuzz targets So add these to the Cargo.toml file: [dependencies]
afl = "*"
url = { git = "https://github.com/servo/rust-url.git", rev = "bfa167b4e0253642b6766a7aa74a99df60a94048" } We chose a particular revision of url that is known to have a bug. Your goal is to find it! Now we’ll need to write the source for the fuzz target in src/main.rs: #[macro_use]
extern crate afl;
extern crate url; fn main() { fuzz!(|data: &[u8]| { if let Ok(s) = std::str::from_utf8(data) { let _ = url::Url::parse(&s); } });
} fuzz! is a utility macro provided by the afl crate that reads bytes from standard input and passes the bytes to the provided closure. In the body of the closure, we call Url::parse with the bytes that AFL generated. If all goes well, url::Url::parse will return an Ok containing a valid Url, or an Err indicating a Url could not be constructed from the String. If Url::parse panics while parsing the String, AFL will treat it as a crash and the AFL UI will indicate as such. One important detail about the fuzz! macro: if a panic occurs within the body of the closure, the panic will be caught and process::abort will be subsequently called. Without the call to process::abort , AFL would not consider the unwinding panic to be a crash.
